import { createRouter, createWebHistory } from 'vue-router'

import HomeComponent from './components/HomeComponent'
import UsuariosComponent from './components/UsuariosComponent'
import LaboratoriosComponent from './components/LaboratoriosComponent'
import FormComponent from './components/commons/FormComponent'
import ModulosComponent from './components/ModulosComponent'

const routes = [
  {
    path: '/',
    component: HomeComponent
  },
  {
    path: '/dashboard',
    component: HomeComponent,
    children: [
      {
        path: 'usuarios/:id',
        component: UsuariosComponent
      },
      {
        path: 'experiencias/:query',
        component: FormComponent
      },
      {
        path: 'modulos',
        component: ModulosComponent
      },
      {
        path: 'laboratorios',
        component: LaboratoriosComponent
      },
    ]
  },  {
    path: '/:token',
    component: HomeComponent,
  }
]

const Router = createRouter({
    history: createWebHistory(),
    routes
  })


  export default Router
